import { Component, OnInit } from '@angular/core';
import { ButtonClickService } from '../../services/button-click.service';

@Component({
  selector: 'app-page5',
  templateUrl: './page5.compotent.html',
  styleUrls: ['./page5.component.css']
})
export class Page5Component implements OnInit {
  buttonClicks: any[] = [];
  message: string = '';

  constructor(private buttonClickService: ButtonClickService) {}

  ngOnInit(): void {}

  fetchButtonClicks(): void {
    const userId = 'yourUserId'; // Kullanıcı ID'sini buradan al veya kullanıcıdan al
    this.buttonClickService.getButtonClicks(userId).subscribe(
      (response: any) => {
        this.buttonClicks = response;
        this.message = '';
      },
      (error: any) => {
        this.message = 'Error fetching button clicks';
        console.error(error);
      }
    );
  }

  logout(): void {
    // Çıkış işlemleri burada yapılabilir
    this.message = 'Logged out successfully!';
  }
}
